import React, { createRef, useState } from "react";
import {
  withGoogleMap,
  GoogleMap,
  Marker,
  InfoWindow,
} from "react-google-maps";

function Map({ center, initMapkers }) {
  return (
    <div className="google-map" style={{ height: "100vh" }}>
      <GoogleMap defaultZoom={14} defaultCenter={center} center={center}>
        {initMapkers.map((it, index) => (
          <Marker
            key={it.place_id}
            position={{
              lat: Number(it.geometry.location.lat),
              lng: Number(it.geometry.location.lng),
            }}
          >
            <InfoWindow>
              <>
                <p>Name:{it.name}</p>
                {it.wait && <p>waitTime:{it.wait.topWait}</p>}
              </>
            </InfoWindow>
          </Marker>
        ))}
      </GoogleMap>
    </div>
  );
}

export default withGoogleMap(Map);
